Here's a basic JavaScript function to sort a table by a specific column:

```javascript
function sortTableByColumn(table, column, asc = true) {
  const dirModifier = asc ? 1 : -1;
  const tBody = table.tBodies[0];
  const rows = Array.from(tBody.rows);

  // Sorting the rows based on the content of the cells in the column
  rows.sort((rowA, rowB) => {
    const a = rowA.cells[column].textContent.trim();
    const b = rowB.cells[column].textContent.trim();

    if (a > b) {
      return 1 * dirModifier;
    }

    if (a < b) {
      return -1 * dirModifier;
    }

    return 0;
  });

  // Removing and re-adding the rows so the browser re-renders the table
  while (tBody.firstChild) {
    tBody.removeChild(tBody.firstChild);
  }

  tBody.append(...rows);

  // Remember how the column is currently sorted
  table.querySelectorAll('th').forEach(th => th.classList.remove('th-sort-asc', 'th-sort-desc'));
  table.rows[0].cells[column].classList.toggle('th-sort-asc', asc);
  table.rows[0].cells[column].classList.toggle('th-sort-desc', !asc);
}
```

Here's how you can use it:

```javascript
// Get the table element
const table = document.querySelector('.table');

// Add event listeners to the table headers
table.rows[0].cells.forEach((th, index) => {
  th.addEventListener('click', () => {
    const asc = th.classList.contains('th-sort-asc');
    sortTableByColumn(table, index, asc);
  });
});
```

This will sort the table by the clicked column. If the column is already sorted in ascending order, it will sort it in descending order, and vice versa.

You can add CSS classes to style the sorted columns:

```css
.th-sort-asc::after {
  content: '\25B2';
}

.th-sort-desc::after {
  content: '\25BC';
}
```

This will add an up arrow to the column headers that are sorted in ascending order, and a down arrow to the column headers that are sorted in descending order. 

This solution does not use jQuery or any other plugins, and it's compatible with modern browsers. 

Please note that this solution assumes that the table has a single `tbody` element and that the `th` elements are direct children of the `tr` element in the `thead`. If your table structure is different, you may need to adjust the code accordingly. 

